import Link from 'next/link'

function HomePage() {
    return ( 
    <div className="header">
        <style jsx global>{`
            *{
                margin: 0;
                padding: 0;
                box-sizing: border-box;
            }
        `}</style>
        <Link href="/">
            <a>Sobre</a>
        </Link>

        <Link href="/sobre">
            <a>Sobre</a>
        </Link>
        <Link href="/contato">
            <a>Conato</a>
        </Link>
    </div>)
}
  
export default HomePage
